import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useNavigate } from 'react-router-dom';
import DietInsufficient from './DietInsufficient';
import DietNormal from './DietNormal';
import DietObesity1 from './DietObesity1';
import DietObesity2 from './DietObesity2';
import DietObesity3 from './DietObesity3';
import DietOverweight1 from './DietOverweight1';
import DietOverweight2 from './DietOverweight2';

// Define the HomePage component with the form
function HomePage() {
  const [formData, setFormData] = useState({
    gender: '',
    age: '',
    height: '',
    weight: '',
    familyHistoryWithOverweight: '',
    FAVC: '',
    FCVC: '',
    NCP: '',
    CAEC: '',
    SMOKE: '',
    CH2O: '',
    FAF: '',
    TUE: '',
    CALC: '',
    MTRANS: ''
  });

  const [prediction, setPrediction] = useState(null);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      const data = await response.json();
      setPrediction(data.prediction);

      // Redirect to the appropriate diet page based on the prediction
      if (data.prediction === 0) {
        navigate('/diet-insufficientweight');
      } else if (data.prediction === 1) {
        navigate('/diet-normalweight');
      } else if (data.prediction === 2) {
        navigate('/diet-overweightlevel1');
      } else if (data.prediction === 3) {
        navigate('/diet-overweightlevel2');
      } else if (data.prediction === 4) {
        navigate('/diet-obesitylevel1');
      } else if (data.prediction === 5) {
        navigate('/diet-obesitylevel2');
      } else if (data.prediction === 6) {
        navigate('/diet-obesitylevel3');
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div>
      <h1>Forest Fire Prediction</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Gender:
          <select name="gender" value={formData.gender} onChange={handleChange}>
            <option value="">Select</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
          </select>
        </label>
        <label>
          Age:
          <input type="number" name="age" value={formData.age} onChange={handleChange} />
        </label>
        <label>
          Height:
          <input type="number" name="height" value={formData.height} onChange={handleChange} />
        </label>
        <label>
          Weight:
          <input type="number" name="weight" value={formData.weight} onChange={handleChange} />
        </label>
        <label>
          Family History with Overweight:
          <select name="familyHistoryWithOverweight" value={formData.familyHistoryWithOverweight} onChange={handleChange}>
            <option value="">Select</option>
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
        <label>
          FAVC:
          <select name="FAVC" value={formData.FAVC} onChange={handleChange}>
            <option value="">Select</option>
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
        <label>
          FCVC:
          <input type="number" name="FCVC" value={formData.FCVC} onChange={handleChange} />
        </label>
        <label>
          NCP:
          <input type="number" name="NCP" value={formData.NCP} onChange={handleChange} />
        </label>
        <label>
          CAEC:
          <select name="CAEC" value={formData.CAEC} onChange={handleChange}>
            <option value="">Select</option>
            <option value="Good">Good</option>
            <option value="Regular">Regular</option>
            <option value="Poor">Poor</option>
          </select>
        </label>
        <label>
          SMOKE:
          <select name="SMOKE" value={formData.SMOKE} onChange={handleChange}>
            <option value="">Select</option>
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
        <label>
          CH2O:
          <input type="number" name="CH2O" value={formData.CH2O} onChange={handleChange} />
        </label>
        <label>
          FAF:
          <input type="number" name="FAF" value={formData.FAF} onChange={handleChange} />
        </label>
        <label>
          TUE:
          <input type="number" name="TUE" value={formData.TUE} onChange={handleChange} />
        </label>
        <label>
          CALC:
          <input type="number" name="CALC" value={formData.CALC} onChange={handleChange} />
        </label>
        <label>
          MTRANS:
          <select name="MTRANS" value={formData.MTRANS} onChange={handleChange}>
            <option value="">Select</option>
            <option value="Walking">Walking</option>
            <option value="Public_Transportation">Public Transportation</option>
            <option value="Motorbike">Motorbike</option>
            <option value="Automobile">Automobile</option>
